					["colorA"] = 1,
					["y"] = 0,
					["x"] = 0,
					["colorG"] = 1,
					["colorType"] = "custom",
					["colorFunc"] = "return function()\n    if (not aura_env.state or not aura_env.state.spellid) then\n        return 1, 0, 0, 1\n    end\n    \n    if  aura_env.OoC then -- Out of Combat\n        aura_env.state.show = false\n        aura_env.state.changed = true \n        return 0,0,0,0\n    end\n    \n    \n    local spellInfo = aura_env.spells[aura_env.state.spellid]\n    if (aura_env.state.expirationTime - GetTime() <= spellInfo.duration * .3) then\n        if aura_env.state.spellid == 146739 and aura_env.foreverCorruption then\n            return 0,0,0,0    \n        end\n        \n        return 0, 1, 0, 1\n    else\n        return spellInfo.r, spellInfo.g, spellInfo.b, 1\n    end\nend",
					["rotate"] = 0,
